import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class AuthService {
  loggedIn: boolean = false
  constructor() { }

  logIn() {
    this.loggedIn = true
    console.log();

  }

  isAuthenticated() {
    console.log(this.loggedIn);

    return this.loggedIn
  }
}
